using Common.Enums;
using Common.Enums.Results;
using Common.Extensions;
using Common.Handlers;
using Common.Interfaces;
using System;
using Xunit;

namespace Common.Tests.Handlers
{
    public class DataUriSchemeHandlerTests
    {
        private readonly IDataUriScheme _dataUriScheme;

        public DataUriSchemeHandlerTests()
        {
            _dataUriScheme = new DataUriSchemeHandler();
        }

        #region GetBytes

        [Theory]
        [InlineData("")] 
        [InlineData(null)] 
        [InlineData("some string")]
        [InlineData("smksmksm,ndjndjndjnd")]
        [InlineData("s,mksmksm,ndjndjndjnd")]
        public void GetBytes_InvalidBase64string_ThrowException(string value)
        {
            var actual = Assert.Throws<InvalidOperationException>(()=>_dataUriScheme.GetBytes(value));

            Assert.Equal(ResultCode.InvalidBase64StringFormat.GetNumericString(), actual.Message);
        }

        [Fact]
        public void GetBytes_ValidInput_Success()
        {
            string base64string = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg==";

            var bytes = _dataUriScheme.GetBytes(base64string);

            Assert.NotEmpty(bytes);
        }

        #endregion

        #region IsValidFileType

        [Theory]
        [InlineData("")]
        [InlineData(null)]
        [InlineData("some string")]
        [InlineData("smksmksm,ndjndjndjnd")]
        [InlineData("s,mksmksm,ndjndjndjnd")]
        public void IsValidFileType_InvalidInput_ReturnFalse(string value)
        {
            bool isValid = _dataUriScheme.IsValidFileType(value, out FileType fileType);

            Assert.False(isValid);
        }

        [Theory]
        [InlineData("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg==")]
        [InlineData("data:image/jpeg;base64,")]
        [InlineData("data:application/pdf;base64,")]
        //.docx
        [InlineData("data:application/vnd.openxmlformats-officedocument.wordprocessingml.document;base64,")]
        //.doc
        [InlineData("data:application/msword;base64,")]
        public void IsValidFileType_ValidInput_Success(string value)
        {
            bool isValid = _dataUriScheme.IsValidFileType(value, out FileType fileType);

            Assert.True(isValid);
        }

        #endregion

        #region IsValidImageType

        [Theory]
        [InlineData("")]
        [InlineData(null)]
        [InlineData("some string")]
        [InlineData("smksmksm,ndjndjndjnd")]
        [InlineData("s,mksmksm,ndjndjndjnd")]
        public void IsValidImageType_InvalidInput_ReturnFalse(string value)
        {
            bool isValid = _dataUriScheme.IsValidImageType(value, out ImageType imageType);

            Assert.False(isValid);
        }

        [Theory]
        [InlineData("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg==")]
        [InlineData("data:image/jpeg;base64,")]
        public void IsValidImageType_ValidInput_Success(string value)
        {
            bool isValid = _dataUriScheme.IsValidImageType(value, out ImageType imageType);

            Assert.True(isValid);
        }

        #endregion

        #region IsValidFile

        [Theory]
        [InlineData("")]
        [InlineData(null)]
        [InlineData("some string")]
        [InlineData("smksmksm,ndjndjndjnd")]
        [InlineData("s,mksmksm,ndjndjndjnd")]
        public void IsValidFile_InvalidInput_ReturnFalse(string value)
        {
            bool isValid = _dataUriScheme.IsValidFile(value);

            Assert.False(isValid);
        }

        [Theory]
            [InlineData("data:application/pdf;base64,")]
        //.docx
        [InlineData("data:application/vnd.openxmlformats-officedocument.wordprocessingml.document;base64,")]
        //.doc
        [InlineData("data:application/msword;base64,")]
        public void IsValidFile_ValidInput_Success(string value)
        {
            bool isValid = _dataUriScheme.IsValidFile(value);

            Assert.True(isValid);
        }

        #endregion


        #region IsValidImage

        [Theory]
        [InlineData("")]
        [InlineData(null)]
        [InlineData("some string")]
        [InlineData("smksmksm,ndjndjndjnd")]
        [InlineData("s,mksmksm,ndjndjndjnd")]
        public void IsValidImage_InvalidInput_ReturnFalse(string value)
        {
            bool isValid = _dataUriScheme.IsValidImage(value);

            Assert.False(isValid);
        }

        [Theory]
        [InlineData("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg==")]
        [InlineData("data:image/jpeg;base64,")]
        public void IsValidImage_ValidInput_Success(string value)
        {
            bool isValid = _dataUriScheme.IsValidImage(value);

            Assert.True(isValid);
        }

        #endregion

    }
}
